	END IF;
	SELECT COUNT(*) INTO _count FROM cms_content_lang
	WHERE staticURL= NEW.staticURL AND contentID<>NEW.contentID;
	IF (_count>0) THEN
		CALL raise_error('Ya existe una ruta estatica con es mismo nombre');
	END IF;
	
    END */$$


DELIMITER ;

